import React from 'react';
import { PlusGrid, PlusGridItem } from '@app/components';
import { Utils } from '@app/utils';

export const LayoutError: React.FC = (props) => {

  const { children } = props;

  const classes = Utils.classes(
    'layout-error'
  );

  return (
    <div className={classes}>
      <PlusGrid style={{ height: '100%' }} alignItems="center" justify="center" >
        <PlusGridItem>
          {children}
        </PlusGridItem>
      </PlusGrid>
    </div >
  );
};
